import Home from "./pages/Home";
import { Routes, Route } from "react-router-dom";

function App() {
     return (
          <div className="max-w-screen-md mx-auto pt-20">
               <Routes>
                    <Route path="/" element={<Home />} />
               </Routes>
          </div>
     );
}

export default App;
